import React from 'react';

export const HeaderLogo: React.FC = () => {
  return (
    <div style={{ 
      display: 'flex', 
      justifyContent: 'center', 
      width: '100%' 
    }}>
      <img 
        src="/logo.png" 
        alt="San Diego City College" 
        style={{ 
          height: "auto", 
          width: "250px",
          margin: "10px 0",
          objectFit: "contain"
        }} 
      />
    </div>
  );
};
